import React from 'react';
import { GoogleMap, LoadScript } from '@react-google-maps/api';

const startPosition = {
    lat: 42.70,
    lng: -84.48
  };

const mapStyle = {
  width: '85vw',
  height: '65vh',
  margin: '3vh',
};


function MapComponent({ onClick }) {
  return (
    <LoadScript googleMapsApiKey={"AIzaSyAxbAf8Ob88i06AIUWdjgJVCdEetuCPdAY"}>
      <GoogleMap
        mapContainerStyle={mapStyle}
        zoom={5}
        center={startPosition}
        onClick={onClick} 
      >
      </GoogleMap>
    </LoadScript>
  );
}

export default React.memo(MapComponent);
